import React, {Component} from 'react'
import LoginComponent from './LoginComponent'
import WelcomeComponent from './WelcomeComponent'
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'

class TodoApp extends Component {
    render() {
        return(
            <div className="TodoApp">
                <Router>
                    <div>
                        <Switch>
                            <Route path="/" exact component={LoginComponent}/>
                            <Route path="/login" component={LoginComponent}/>
                            <Route path="/welcome/:name" component={WelcomeComponent}/>
                            <Route path="/todos" component={ListTodoComponent}/>
                            <Route component={ErrorComponent}/>
                        </Switch>
                    </div>
                </Router>
                {/* <LoginComponent/>
                <WelcomeComponent/> */}
            </div>
        )
    }
}

function ErrorComponent() {
    return <div>An error ocurred. Please contact technique support.</div>
}

class ListTodoComponent extends Component{
    constructor(props) {
        super(props)
        this.state = {
            todo : { id : 1, description : "This is a demo todo item."}
        }
    }

    render() {
        return (
            <div>
                <h1>Todo List</h1>
                <table>
                    <thead>
                        <tr>
                            <th>id</th>
                            <th>description</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td>{this.state.todo.id}</td>
                            <td>{this.state.todo.description}</td>
                        </tr>
                    </tbody>
                </table>
            </div>
        )
    }
}


export default TodoApp
